    def get_unique_fullname(self, objtype, myfullname):
        fullname_ajusted = myfullname
        if myfullname in self.dic_unique_fullnames[objtype]:
            iindex = 1
            #identify a unique fullname
            while iindex < 100:
                print("myfullname=%s" + myfullname)
                key = myfullname + '.' + str(iindex)
                if key not in self.dic_unique_fullnames[objtype]:
                    fullname_ajusted = key
                    break 
                iindex += 1
        log.info("\t\t unique fullname %s" % (fullname_ajusted))
        return fullname_ajusted 
    
