    def create_object(self, _type, name, file, filepath, fullname=None, parent=None, bookmark=None):
        if _type == None or name == None or file == None or filepath == None: 
            return

        # object already created, skip
        #if name in dict_obj:
        #    return dict_obj[name]

        log.info("Creating object type=%s name=%s fullname=%s" % (str(_type), str(name), str(fullname)))
        custobj = cast.analysers.CustomObject()
        custobj.set_type(_type)
        custobj.set_name(name)
        custobj.set_guid(fullname)
        #log.debug(" 6>fullname %s" % (str(fullname)))
        if fullname is None:
            custobj.set_fullname(filepath + '/' + name)
        else: 
            #log.debug(" fullname set %s" % (str(fullname)))
            custobj.set_parent(file)
            custobj.set_fullname(fullname)
        if parent is None:
            custobj.set_path(file)
        else:
            custobj.set_parent(parent)
        custobj.save()    
        if bookmark is not None:
            custobj.save_position(bookmark);  
        #dict_obj[name] = custobj
        return custobj

