    def start_file(self, file):             # Extension point : each file
        filepath=file.get_path()
        self.nb_filesIdentified += 1
        log.info('\t ODMAnalysis start_file : %s' % filepath)

        if re.search('[\.][cC][xX][pP][lL][aA][nN][sS][eE][tT]$', filepath) != None:
            self.scan_planset_file(file)

        
        if re.search('[\.][cC][xX][jJ][oO][bB][sS][eE][tT]$', filepath) != None:
            self.scan_jobset_file(file)

        if re.search('[\.][cC][xX][pP][bB][lL][iI][nN][kK]$', filepath) != None:
            self.scan_pblink_file(file)


