    def scan_jobset_file(self, file):
        filepath = file.get_path()
        log.debug("INIT scan_jobset_file > " +str(filepath))        
        set_jobset = set()

        with open(filepath, 'r') as processing_file:
            iindex = 0
            for line in processing_file:
                #log.debug("line > " +str(line))        
                iindex += 1 
                result = re.search(r"^([A-Za-z0-9$]+)[ \t/s]*;(.*)", line)
                if result:
                    jobset_name = result.group(1)
                    jobset_name = jobset_name.strip()
                    other_data = result.group(2)
                    #log.debug("2>%s" % (str(jobset_name)))
                    if jobset_name: 
                        if not set_jobset in set_jobset:
                            #create the jobset
                            fullname = filepath + "\\" + jobset_name
                            obj = self.create_object(_type="CortexJobset", name=jobset_name, file=file, filepath=filepath, fullname=fullname, parent=file, bookmark=None)
                            set_jobset.add(jobset_name)
                            self.dic_jobset[jobset_name] = obj
                else:
                    log.warning(" WARN : coulnd't parse line %s" % line)
                #print line
        self.nb_filesParsed += 1        
    
